        marginRight: '20px',
        width: '250px',
        height: '250px',
        backgroundColor: 'yellow',
      }}
    >
      <h1 style={{backgroundColor: '#ff0000', width: '100%'}}>aaaaa</h1>
    </div>
  );
};
export default Home;
